import { Routes, Route, Navigate } from 'react-router-dom';

import './App.css';
import MainPage from './containers/mainPage';


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/Hellow!' element={<MainPage />} />
        <Route path="/" element={<Navigate replace to='/welcome' />} />
      </Routes>
    </div>
  );
}

export default App;
